import React from "react";
import logo from '../../public/images/'; //

function Jumbotron() {
    return (
        <div className="container mt-3 text-center">
            <div className="jumbotron jumbotron-fluid bg-info">
                <h1 className="display-4 font-weight-bold text-white">(REACT) GOOGLE BOOK SEARCH</h1>

                <h3 className="font-weight-bold text-white">Search for and Save Books of Interest</h3>
            </div>
        </div>
    )
}

export default Jumbotron;
